// src/shared/Layout.js

import React from "react";
import Header from "./header/Header";

const layoutStyles = {
  display: "flex",
  flexDirection: "column",
  justifyContent: "center",
  alignItems: "center",
  minHeight: "90vh",
};

function Layout({ children }) {
  return (
    <div>
      <Header />
      <Form />
      <List />
      <div style={{ ...layoutStyles }}>{children}</div>
    </div>
  );
}

export default Layout;
